import React from "react";
import styles from "../styles/sidebarOption.module.scss";

function SidebarOption({ text, Icon }) {
  return (
    <div className={styles.sidebarOption}>
      <Icon />
      <h2>{text}</h2>
    </div>
  );
}

export default SidebarOption;
